import Header from './Components/Header';
import  Footer from './Components/Footer';
import Clock from './Components/Clock';

function App() {
  return (
    <div>
      <div>
        <Header />
        <Clock />
        <Footer />
      </div>
    </div>
  );
}

export default App;
